INSERT INTO `MailsInfo` (`Serial`, `MailsID`, `Lang`, `Title`, `Content`, `Sender`, `URL`) VALUES
	(1, 1, 0, 'Welcome to PetaRush', 'So glad to have you in PetaRush. Come and join the festivity!', 'Sender: Direct Team', 'https://www.google.com'),
	(2, 1, 2, 'Welcome to PetaRush', 'So glad to have you in PetaRush. Come and join the festivity!', 'Sender: Direct Team', 'https://www.google.com'),
	(3, 1, 6, '《PetaRush》へようこそ', '《PetaRush》へようこそ，一緒に《PetaRush》で盛り上がりましょう！', '送信者：研究開発チーム', 'https://www.google.com'),
	(4, 1, 7, '<PetaRush>에 오신 걸 축하드립니다.', '<PetaRush>에 오신 걸 환영합니다. 당신을 <페타 러시> Peta의 대형 행사에 초대합니다!', '발신자: 개발팀', 'https://www.google.com'),
	(5, 1, 11, 'ยินดีต้อนรับสู่PetaRush', 'ยินดีต้อนรับสู่ 《PetaRush》เราขอเชิญคุณมาร่วมงานPetaครั้งสำคัญใน PetaRush', 'ผู้ส่ง：ทีมผู้วิจัยและพัฒนา', 'https://www.google.com'),
	(6, 1, 5, 'Selamat datang di PetaRush', 'Selamat datang di PetaRush. Dengan senang hati, kami mengundang Anda untuk bergabung dengan kami di acara akbar Peta, yaitu PetaRush!', 'Pengirim: Tim Pengembang', 'https://www.google.com'),
	(7, 1, 4, 'Maligayang pagdating sa “PetaRush”', 'Maligayang pagdating sa “PetaRush”. Taos-puso kaming inaanyayahan na sumali sa amin sa malaking kaganapan ng Peta, “pagtakbo ng hayop” !', 'Nagpadala: pangkat ng R&D', 'https://www.google.com'),
	(8, 1, 3, 'Bienvenido a PetaRush', '¡Bienvenido a PetaRush! ¡Venga y únase a la fiesta de Peta con nosotros!', 'Remitente: Equipo de desarrolladores', 'https://www.google.com'),
	(9, 1, 1, 'Willkommen bei PetaRush', 'Willkommen bei PetaRush! Komm und feiere mit uns das Peta Fest!', 'Absender: Entwickler-Team', 'https://www.google.com'),
	(10, 1, 9, 'Bem-vindo à PetaRush', 'Bem-vindo à PetaRush! Vem participar das comemorações da Peta com a gente!', 'Remetente: Equipe de desenvolvedores', 'https://www.google.com'),
	(11, 1, 10, 'Добро пожаловать в PetaRush', 'Добро пожаловать в PetaRush! Присоединяйтесь к празднику Peta вместе с нами!', 'Отправитель: команда разработчиков', 'https://www.google.com'),
	(12, 1, 8, '"PetaRush" မွ လႈိက္လွဲစြာႀကိဳဆိုပါသည္။', '"PetaRush" မွ ႀကိဳဆိုပါသည္။ Peta ၏အဓိကပြဲျဖစ္သည့္ "PetaRush" တြင္ ပါဝင္ဆင္ႏႊဲရန္ ေလးစားစြာျဖင့္ ဖိတ္ၾကားအပ္ပါသည္။', 'ေပးပို႔သူ- R&D အဖဲြ႔', 'https://www.google.com'),
	(13, 1, 12, '歡迎來到《PetaRush》', '歡迎來到《PetaRush》誠摯邀請你一同來參與《動物大奔走》這個Peta的大型盛事！', '寄件人：研發團隊', 'https://www.google.com'),
	(14, 5, 0, 'Daily Login Bonus', 'During the Event Period, players will receive "50 Marscoin Qualifier Tickets" after creating a new character. Meanwhile, you can claim 30 Marscoin Qualifier tickets on the event page every day for once. Remember to claim the tickets before 23:59 of each day, or they will be expired.\n\n※Click on the link below to check out the details.\nhttps://chr2.io/petarush/announcement/?lang=en&id=1', 'Sender: Direct Team', ''),
	(15, 5, 2, 'Daily Login Bonus', 'During the Event Period, players will receive "50 Marscoin Qualifier Tickets" after creating a new character. Meanwhile, you can claim 30 Marscoin Qualifier tickets on the event page every day for once. Remember to claim the tickets before 23:59 of each day, or they will be expired.\n\n※Click on the link below to check out the details.\nhttps://chr2.io/petarush/announcement/?lang=en&id=1', 'Sender: Direct Team', ''),
	(16, 5, 12, '天天登入送', '活動期間內，玩家完成創建角色後，立即獲贈「火星幣晉級賽邀請函x50」，每天還可在活動UI介面領取一次「火星幣晉級賽邀請函x30」，請務必每天領取，否則系統將於每天晚上23:59時，進行回收。\n\n※詳情請見：\nhttps://chr2.io/petarush/announcement/?lang=tc&id=1', '寄件人：研發團隊', ''),
	(17, 6, 0, 'The Speedrunning Leaderboard', 'During the Event Period, as long as you participate in the "Peta Qualifier - Marscoin Qualifier", the settlements will be automatically recorded to the leaderboard of the event webpage after the race. At the end of the event, the top "100" players who finish the race in the shortest time will receive corresponding rewards.\n\n※Click on the link below to check out the details.\nhttps://chr2.io/petarush/announcement/?lang=en&id=2', 'Sender: Direct Team', ''),
	(18, 6, 2, 'The Speedrunning Leaderboard', 'During the Event Period, as long as you participate in the "Peta Qualifier - Marscoin Qualifier", the settlements will be automatically recorded to the leaderboard of the event webpage after the race. At the end of the event, the top "100" players who finish the race in the shortest time will receive corresponding rewards.\n\n※Click on the link below to check out the details.\nhttps://chr2.io/petarush/announcement/?lang=en&id=2', 'Sender: Direct Team', ''),
	(19, 6, 12, '極速排行榜', '排行榜活動期間內，只要參加「Peta晉級賽-火星幣晉級賽」，完賽即可自動登錄成績至活動網頁排行榜，活動結束時，最短時間跑完賽道的前「100」名玩家，將會獲得對應獎勵。 \n\n※詳情請見： \nhttps://chr2.io/petarush/announcement/?lang=tc&id=2', '寄件人：研發團隊', ''),
	(20, 7, 0, 'The Marscoin Billionaire Leaderboard', 'During The Marscoin Billionaire Leaderboard event, the accumulated Marscoins on players will be automatically recorded to the leaderboard on the event webpage. At the end of the event, the top "100" players who have accumulated the most Marscoin will receive corresponding rewards.\n\n※Click on the link below to check out the details.\nhttps://chr2.io/petarush/announcement/?lang=en&id=3', 'Sender: Direct Team', ''),
	(21, 7, 2, 'The Marscoin Billionaire Leaderboard', 'During The Marscoin Billionaire Leaderboard event, the accumulated Marscoins on players will be automatically recorded to the leaderboard on the event webpage. At the end of the event, the top "100" players who have accumulated the most Marscoin will receive corresponding rewards.\n\n※Click on the link below to check out the details.\nhttps://chr2.io/petarush/announcement/?lang=en&id=3', 'Sender: Direct Team', ''),
	(22, 7, 12, '富豪排行榜', '排行榜活動期間內，玩家身上累積的火星幣，將會自動登錄至活動網頁排行榜，活動結束時，累積最多火星幣的前「100」名玩家，將會獲得對應獎勵。\n\n※詳情請見：\nhttps://chr2.io/petarush/announcement/?lang=tc&id=3', '寄件人：研發團隊', ''),
	(23, 8, 0, 'Bug Bounty', 'During the Early Access DEMO period, as long as a bug is found in the game and reported through the designated channel, the first reporter will receive the corresponding reward. The reward will be issued after it has been verified by the official personnel on the seventh day after the opening of PetaRush’s Second Closed Beta Test based on the severity of the bug.\n \n※BUG report channel：\nhttps://forms.gle/Cp8zSZ3pAnfzP2sDA\n\n※Click on the link below to check out the details.\nhttps://chr2.io/petarush/announcement/?lang=en&id=5', 'Sender: Direct Team', ''),
	(24, 8, 2, 'Bug Bounty', 'During the Early Access DEMO period, as long as a bug is found in the game and reported through the designated channel, the first reporter will receive the corresponding reward. The reward will be issued after it has been verified by the official personnel on the seventh day after the opening of PetaRush’s Second Closed Beta Test based on the severity of the bug.\n \n※BUG report channel：\nhttps://forms.gle/Cp8zSZ3pAnfzP2sDA\n\n※Click on the link below to check out the details.\nhttps://chr2.io/petarush/announcement/?lang=en&id=5', 'Sender: Direct Team', ''),
	(25, 8, 12, '除蟲大作戰', '搶先體驗DEMO期間內，只要在遊戲中發現BUG，並且透過指定管道回報，經官方人員核實無誤，依據BUG的嚴重程度，首位回報者將會在「CB2」開放後第七天，獲得相對應的獎勵。\n\n※回報BUG管道：\nhttps://forms.gle/Cp8zSZ3pAnfzP2sDA\n\n※詳情請見：\nhttps://chr2.io/petarush/announcement/?lang=tc&id=5', '寄件人：研發團隊', ''),
	(26, 9, 0, 'Daily Login Bonus', 'The Reward of the “Peta Qualifier - Marscoin Qualifier” will be doubled during the event period. For those who want to get into the Marscoin Billionaire, you must not miss it!\n\n※Click on the link below to check out the details.\nhttps://chr2.io/petarush/announcement/?lang=en&id=6', 'Sender: Direct Team', ''),
	(27, 9, 2, 'Daily Login Bonus', 'The Reward of the “Peta Qualifier - Marscoin Qualifier” will be doubled during the event period. For those who want to get into the Marscoin Billionaire, you must not miss it!\n\n※Click on the link below to check out the details.\nhttps://chr2.io/petarush/announcement/?lang=en&id=6', 'Sender: Direct Team', ''),
	(28, 9, 12, '獎金加碼送', '活動期間內，「Peta晉級賽-火星幣賽」的獎金翻倍送，想要把握最後機會，晉身富豪排名的玩家們，千萬別錯過！\n\n※詳情請見：\nhttps://chr2.io/petarush/announcement/?lang=tc&id=6', '寄件人：研發團隊', ''),
	(29, 10, 0, 'Item collection', 'You don\'t have enough vacant slots in your bag,please make some space and try again.', 'Sender: Direct Team', ''),
	(30, 10, 2, 'Item collection', 'You don\'t have enough vacant slots in your bag,please make some space and try again.', 'Sender: Direct Team', ''),
	(31, 10, 12, '道具領取', '由於物品數量已超過上限，請整理背包後再從附件領取。', '寄件人：研發團隊', ''),
	(32, 11, 12, 'DEMO4 測試說明', '親愛的玩家~您好！\n為求遊戲的平衡性，DEMO4的測試，是以與Demi-Holim NFT合作的Demi Peta為主，\n玩家可以從本次測試的技能與外觀的關係，一窺預定在10/18解盲的Demi Peta的一部分技能組合。\n在這次DEMO4的技能，都暫時用英數縮寫做為技能名稱，待測試結束後會公布正式的技能名稱。\n如之前所公告的，PetaRush在10月份密集的做大量DEMO測試，是因為要調整數值平衡，也會視情況固定於每日下午14:00進行針對競賽數值做平衡調整。\n過去，已經調整「天氣適應力的影響效果較強」以及「干擾技能效果的數值提高」與「被妨礙技能條件的效果數值提高」。\n在本次的測試，則是將「增益效果的上坡、平地、下坡、順風、側風、逆風的適應力數值提升」，因為這些效果要Peta在特定的位置上才會有用，所以期待本次的調整，可以讓抓對位置施放的Peta會跑的更快、體力消耗更少。\nPetaRush開發團隊敬上', '寄件人：研發團隊', ''),
	(33, 11, 2, 'Demo 4 Notification', 'We are glad to announce that the PetaRush Demo 4 features the Demi-Holim NFT. This is to ensure the game balance in the future after they go live! Additionally, it offers you a sneak peek at what powerful skills Demi Peta may have once the blind box reveals itself on Oct 18th!\nHere are a few things we hope you know before the gameplay,\nFirst, the skill names you see at Demo version are the abbreviations combines with English characters and numbers. We will announce their official names at the end of Demo version gameplay. Please look forward to it!\nSecond, we have announced that the PetaRush team will change skill effects at 14:00 every day to ensure the game balance. Before, we have optimized the following skills, “Decrease the impact of Peta’s adaption to weathers,” “Increase attack skill effects,” and “Increase on-hit skill effects.” This time, we will optimize the skills brings bonus effects to the landscapes (Uphill, Downhill, and Flat) and wind directions (Tailwind, Headwind, and Crosswind.) Since we have noticed these skills require Peta to be in the specific environment, we hope Petas can earn more effects once they successfully activate the skills under such restricted conditions.', 'Sender: Direct Team', ''),
	(34, 12, 0, 'Thank you for your support to PetaRush', 'Thank you for your support to PetaRush! Here are your {N} {areaID} from the utility of {text}. Wish you enjoy it!', 'Sender: Direct Team', ''),
	(35, 12, 2, 'Thank you for your support to PetaRush', 'Thank you for your support to PetaRush! Here are your {N} {areaID} from the utility of {text}. Wish you enjoy it!', 'Sender: Direct Team', ''),
	(36, 12, 12, '感謝你對Peta Rush的支持', '感謝你對PetaRush的支持，在此送上盲盒開出 {text} 的賦能 「{areaID}」{N}張，讓你在火星上盡情的奔跑！', '寄件人：研發團隊', ''),
	(37, 13, 0, 'Mycard Charging Issue Explanation', 'You used Mycard to charge on {time1}, and the items have already been sent to you. Wish you a nice day!', 'Sender: Direct Team', ''),
	(38, 13, 2, 'Mycard Charging Issue Explanation', 'You used Mycard to charge on {time1}, and the items have already been sent to you. Wish you a nice day!', 'Sender: Direct Team', ''),
	(39, 13, 12, 'MyCard補發說明', '玩家於{time1} 儲值申請已通過，已派發給玩家。祝您有個美好的一天！', '研發團隊', ''),
	(40, 14, 0, '<color=#F6D3A4>PetaRush Highlight</color>', 'Welcome to PetaRush! We have prepared so many wonderful events to greet you! By joining the PetaRush CB2, you might win rich rewards for the PetaRush open-beta version!\n\nCB2 Events Guide:\n※\nhttps://lihi1.com/HMVpd', 'Sender: Direct Team', ''),
	(41, 14, 2, '<color=#F6D3A4>PetaRush Highlight</color>', 'Welcome to PetaRush! We have prepared so many wonderful events to greet you! By joining the PetaRush CB2, you might win rich rewards for the PetaRush open-beta version!\n\nCB2 Events Guide:\n※\nhttps://lihi1.com/HMVpd', 'Sender: Direct Team', ''),
